// src/components/CustomerNavbar.js
import React from 'react';
import { NavLink, useNavigate } from "react-router-dom";

// This component is purely for the customer's navigation links
function CustomerNavbar({ onLogout }) {
  return (
    <>
      {/* Link to the Customer Dashboard (Welcome page) */}
      <NavLink 
        to="/dashboard" 
        className={({ isActive }) => (isActive ? "nav-link active" : "nav-link")}
      >
        My Dashboard
      </NavLink>
      
      {/* Link to the Make Payment Page */}
      <NavLink 
        to="/make-payment" 
        className={({ isActive }) => (isActive ? "nav-link active" : "nav-link")}
      >
        Make Payment
      </NavLink>

      {/* Logout Button (uses the function passed from App.js) */}
      <button 
        onClick={onLogout} 
        className="nav-button logout-btn"
      >
        Logout
      </button>
    </>
  );
}

export default CustomerNavbar;
